import React from "react";

const CharacterDetail = (props) => {
  return (
    <>
      <article>
        <img src={props.img} alt={`Este personaje es : ${props.name} `} />
        <h3>{props.name}</h3>
        <p>{props.species}</p>
        <p>{props.origin}</p>
        <p>{props.episode}</p>
      </article>
    </>
  );
};

export default CharacterDetail;
